

function importFromChat() {
    const messages = document.querySelectorAll('#chat-content p')
    let sender = null;
    for (let i = messages.length - 1; i >= 0; i--) {
        let p = messages[i];
        let header = p.textContent.match(/(?<=DS).+\|/);
        if (header) sender =
            console.log(header);
    }
}

